DROP TABLE IF EXISTS `notifications`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `notifications` (
  `id` int NOT NULL AUTO_INCREMENT,
  `type` tinyint DEFAULT NULL COMMENT '0: no category, 1: Request, 2:Class, 3:Invoice',
  `admin` tinyint(1) DEFAULT NULL,
  `teacherID` int DEFAULT NULL,
  `guardianID` int DEFAULT NULL,
  `studentID` int DEFAULT NULL,
  `adminMsg` varchar(800) DEFAULT NULL,
  `teacherMsg` varchar(800) DEFAULT NULL,
  `guardianMsg` varchar(800) DEFAULT NULL,
  `seenByAdmin` tinyint NOT NULL DEFAULT '0',
  `seenByGuardian` tinyint NOT NULL DEFAULT '0',
  `seenByTeacher` tinyint NOT NULL DEFAULT '0',
  `createdAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `gnrel` (`guardianID`),
  KEY `tnrel` (`teacherID`),
  KEY `snrel` (`studentID`),
  CONSTRAINT `gnrel` FOREIGN KEY (`guardianID`) REFERENCES `guardians` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `snrel` FOREIGN KEY (`studentID`) REFERENCES `students` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `tnrel` FOREIGN KEY (`teacherID`) REFERENCES `teachers` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=937 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

