  `Sun` timestamp NULL DEFAULT NULL,
  `Mon` timestamp NULL DEFAULT NULL,
  `Tue` timestamp NULL DEFAULT NULL,
  `Wed` timestamp NULL DEFAULT NULL,
  `Thu` timestamp NULL DEFAULT NULL,
  `Fri` timestamp NULL DEFAULT NULL,
